import React from "react";
import Button from "@material-ui/core/Button";
import Paper from "@material-ui/core/Paper";
import { withStyles } from "@material-ui/core/styles";
import { greeting } from "./GreetingStyles";
import CssBaseline from "@material-ui/core/CssBaseline";
import { Link } from "react-router-dom";

const Greeting = (props) => {
  const { classes } = props;
  return (
    <div style={{ margin: "auto", width: "50%", marginTop: "50px" }}>
      <CssBaseline />
      <Paper className={classes.paper}>
        <h1>Welcome to the LEVEL UP APP!</h1>
        <h3>Start leveling up today by signing up!</h3>
        <p>
          This app is super simple to use, and may help you in pushing you
          towards your goals! See the about page for more details
        </p>
        <div>
          <Link to="/login">
            <Button variant="outlined" className={classes.button}>
              Login
            </Button>
          </Link>
          <Link to="/register">
            <Button variant="outlined" className={classes.button}>
              Register
            </Button>
          </Link>
          <Link to="/about">
            <Button variant="outlined" className={classes.button}>
              About
            </Button>
          </Link>
        </div>
      </Paper>
    </div>
  );
};

export default withStyles(greeting)(Greeting);
